import React, { useState, useEffect } from 'react';
import {
    Box,
    Container,
    Paper,
    Typography,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    CircularProgress,
    Alert,
    Grid
} from '@mui/material';
import axios from 'axios';

const StudentResults = () => {
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const [results, setResults] = useState(null);
    const [studentInfo, setStudentInfo] = useState(null);

    useEffect(() => {
        const fetchResults = async () => {
            try {
                const studentToken = localStorage.getItem('studentToken');
                if (!studentToken) {
                    setError('Please login to view your results');
                    setLoading(false);
                    return;
                }

                const response = await axios.get(
                    `${process.env.REACT_APP_API_URL}/results/student`,
                    {
                        headers: {
                            Authorization: `Bearer ${studentToken}`
                        }
                    }
                );

                setResults(response.data.results);
                setStudentInfo(response.data.student);
            } catch (err) {
                setError(err.response?.data?.message || 'Failed to fetch results');
            } finally {
                setLoading(false);
            }
        };

        fetchResults();
    }, []);

    if (loading) {
        return (
            <Box display="flex" justifyContent="center" alignItems="center" minHeight="60vh">
                <CircularProgress />
            </Box>
        );
    }

    if (error) {
        return (
            <Container maxWidth="md">
                <Alert severity="error" sx={{ mt: 4 }}>
                    {error}
                </Alert>
            </Container>
        );
    }

    if (!results || results.length === 0) {
        return (
            <Container maxWidth="md">
                <Alert severity="info" sx={{ mt: 4 }}>
                    No results found
                </Alert>
            </Container>
        );
    }

    return (
        <Container maxWidth="lg">
            <Paper sx={{ p: 4, mt: 4 }}>
                <Typography variant="h4" component="h1" gutterBottom>
                    Student Results
                </Typography>

                {studentInfo && (
                    <Grid container spacing={2} sx={{ mb: 4 }}>
                        <Grid item xs={12} sm={6}>
                            <Typography variant="subtitle1">
                                <strong>Name:</strong> {studentInfo.name}
                            </Typography>
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <Typography variant="subtitle1">
                                <strong>Roll Number:</strong> {studentInfo.rollNumber}
                            </Typography>
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <Typography variant="subtitle1">
                                <strong>Program:</strong> {studentInfo.program}
                            </Typography>
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <Typography variant="subtitle1">
                                <strong>Stream:</strong> {studentInfo.stream}
                            </Typography>
                        </Grid>
                    </Grid>
                )}

                {results.map((result, index) => (
                    <Box key={index} sx={{ mb: 4 }}>
                        <Typography variant="h6" gutterBottom>
                            Semester {result.semester} - {result.academicYear}
                        </Typography>
                        <TableContainer>
                            <Table>
                                <TableHead>
                                    <TableRow>
                                        <TableCell>Subject</TableCell>
                                        <TableCell align="right">Credits</TableCell>
                                        <TableCell align="right">Marks</TableCell>
                                        <TableCell align="right">Grade</TableCell>
                                    </TableRow>
                                </TableHead>
                                <TableBody>
                                    {result.subjects.map((subject, subIndex) => (
                                        <TableRow key={subIndex}>
                                            <TableCell>{subject.name}</TableCell>
                                            <TableCell align="right">{subject.credits}</TableCell>
                                            <TableCell align="right">{subject.marks}</TableCell>
                                            <TableCell align="right">{subject.grade}</TableCell>
                                        </TableRow>
                                    ))}
                                </TableBody>
                            </Table>
                        </TableContainer>
                        <Box sx={{ mt: 2 }}>
                            <Typography variant="subtitle1">
                                <strong>Semester CGPA:</strong> {result.semesterCGPA}
                            </Typography>
                            <Typography variant="subtitle1">
                                <strong>Result Status:</strong> {result.status}
                            </Typography>
                        </Box>
                    </Box>
                ))}

                {results.length > 0 && (
                    <Box sx={{ mt: 4 }}>
                        <Typography variant="h6" gutterBottom>
                            Final Result
                        </Typography>
                        <Grid container spacing={2}>
                            <Grid item xs={12} sm={6}>
                                <Typography variant="subtitle1">
                                    <strong>Overall CGPA:</strong> {results[0].overallCGPA}
                                </Typography>
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <Typography variant="subtitle1">
                                    <strong>Final Status:</strong> {results[0].finalStatus}
                                </Typography>
                            </Grid>
                        </Grid>
                    </Box>
                )}
            </Paper>
        </Container>
    );
};

export default StudentResults;
